import{_,o as e,c as t,e as o}from"./app.efeddd24.js";const a={},c=o('<h1 id="\u738B\u9633\u660E\u5927\u4F20-\u7B2C\u4E8C\u56DE\u53E4\u8D8A\u9633\u660E\u5B50-\u5E74\u8F6E" tabindex="-1"><a class="header-anchor" href="#\u738B\u9633\u660E\u5927\u4F20-\u7B2C\u4E8C\u56DE\u53E4\u8D8A\u9633\u660E\u5B50-\u5E74\u8F6E" aria-hidden="true">#</a> \u738B\u9633\u660E\u5927\u4F20-\u7B2C\u4E8C\u56DE\u53E4\u8D8A\u9633\u660E\u5B50-\u5E74\u8F6E</h1><blockquote><p>\u4E00\u4E2A\u5BB6\u65CF\u7684\u7279\u5F81, \u5FBD\u5F81\u5982\u6811\u4E4B\u5E74\u8F6E.</p></blockquote><p>\u300A\u738B\u9633\u660E\u5927\u4F20\u300B\u7684\u7B2C\u4E8C\u56DE, \u89C6\u89D2\u4ECE\u738B\u9633\u660E\u6240\u5904\u7684\u65F6\u4EE3, \u805A\u96C6\u5230\u4ED6\u4E2A\u4EBA\u7684\u80CC\u666F. \u5E74\u8F6E\u4E00\u8282, \u8BB2\u7684\u5C31\u662F\u738B\u9633\u660E\u7684\u5BB6\u65CF.</p><p>\u867D\u7136\u738B\u9633\u660E\u7684\u8FDC\u7956\u53EF\u4EE5\u4E0A\u6EAF\u5230\u738B\u7FB2\u4E4B, \u4F46\u8FD9\u91CC\u5374\u4E4B\u53EA\u4ED6\u7684\u516D\u7956\u738B\u7EB2\u8BB2\u8D77.</p><p>\u738B\u7EB2\u662F\u5143\u672B\u660E\u521D\u65F6\u6587\u6B66\u5168\u624D\u7684\u540D\u58EB. 70 \u5C81\u65F6\u88AB\u597D\u53CB\u5218\u4F2F\u6E29\u63A8\u8350, \u5F53\u4E86\u5175\u90E8\uF92C\u4E2D. \u5728\u5E7F\u4E1C\u5F81\u82D7\u65F6\u6B7B\u4E8E\u589E\u57CE. \u5176\u5B50\u738B\u5F66\u8FBE, \u7528\u7F8A\u76AE\u88F9\u5176\u7236\u5C38\u4F53\u56DE\u8001\u5BB6, \u75DB\u7236\u4EE5\u5FE0\u6B7B, \u800C\u671D\u5EF7\u5F85\u4E4B\u592A\u8584, \u7EC8\u751F\u9690\u5C45.</p><p>\u738B\u5F66\u8FBE\u7684\u513F\u5B50\u738B\u4E0E\u51C6\u4E5F\u4FE1\u5949\u5112\u5BB6 &quot;\u9041\u4E16\u65E0\u95F7&quot; \u7684\u4FE1\u6761\u4E0D\u53BB\u5F53\u5B98. \u4E3A\u4E86\u8EB2\u907F\u5F53\u65F6\u671D\u5EF7 &quot;\u8BBF\u6C42\u9057\u9038&quot; \u9003\u5165\u5C71\u4E2D, \u4F24\u7740\u4E86\u811A\u88AB\u6349\u4E86\u51FA\u6765. \u4F46\u5176\u6C14\u8D28\u611F\u5316\u4E86\u671D\u5EF7\u6D3E\u6765\u7684\u90E8\u4F7F. \u90E8\u4F7F\u653E\u4E86\u4ED6, \u5E76\u4E3E\u8350\u4ED6\u7684\u513F\u5B50\u738B\u4E16\u6770\u5F53\u4E86\u79C0\u624D.</p><p>\u738B\u4E16\u6770\u867D\u5F53\u4E86\u79C0\u624D, \u4F46\u53BB\u5927\u8003\u65F6, \u56E0\u4E3A\u8BA4\u4E3A\u5F53\u65F6\u8003\u751F\u987B\u6563\u53D1\u8131\u8863\u63A5\u53D7\u68C0\u67E5\u7684\u53CD\u4F5C\u5F0A\u662F\u79CD\u4FAE\u8FB1, \u6240\u4EE5\u672A\u8FDB\u8003\u573A\u800C\u8FD4.</p><p>\u738B\u4E16\u6770\u7684\u513F\u5B50\u738B\u5929\u53D9\u5C31\u662F\u738B\u9633\u660E\u7684\u7956\u7236. \u4ED6\u4E5F\u4E00\u8F88\u5B50\u6CA1\u5F53\u8FC7\u5B98. \u4F46\u5374\u57F9\u517B\u51FA\u4E00\u4E2A\u72B6\u5143\u513F\u5B50\u738B\u534E\u548C\u4E00\u4E2A\u65B0\u5EFA\u4F2F\u5B59\u5B50\u738B\u9633\u660E.</p><hr><hr>',10),r=[c];function p(n,s){return e(),t("div",null,r)}var d=_(a,[["render",p],["__file","\u738B\u9633\u660E\u5927\u4F20-\u7B2C\u4E8C\u56DE\u53E4\u8D8A\u9633\u660E\u5B50-\u5E74\u8F6E.html.vue"]]);export{d as default};
